export default function Iban() {
  const banks = [
    {
      samaCode: "55",
      bankName: "Banque Saudi Fransi",
      nameEn: "Banque Saudi Fransi",
      nameAr: "البنك السعودي الفرنسي",
    },
    {
      name: "Alrajhi Bank",
      samaCode: "80",
      nameEn: "Alrajhi Bank",
      nameAr: "بنك الراجحي",
    },
    {
      samaCode: "10",
      bankName: "National Commercial Bank",
      nameEn: "National Commertial Bank",
      nameAr: "البنك الأهلي التجاري",
    },
    {
      samaCode: "45",
      bankName: "Saudi British Bank",
      nameEn: "SABB",
      nameAr: "ساب",
    },
    {
      samaCode: "20",
      bankName: "Riyadh Bank",
      nameEn: "Riyad Bank",
      nameAr: "بنك الرياض",
    },
    {
      samaCode: "40",
      bankName: "Saudi American Bank",
      nameEn: "SAMBA",
      nameAr: "سامبا",
    },
    {
      samaCode: "05",
      bankName: "Alinma Bank",
      nameEn: "AL Inma Bank",
      nameAr: "بنك الانماء",
    },
    {
      samaCode: "50",
      bankName: "Alawwal bank",
      nameEn: "AlAwwal Bank",
      nameAr: "البنك الأول",
    },
    {
      samaCode: "60",
      bankName: "Bank AlJazira",
      nameEn: "Bank Aljazerah",
      nameAr: "بنك الجزيرة",
    },
    {
      samaCode: "65",
      bankName: "Saudi Investment Bank",
      nameEn: "Saudi Investment Bank",
      nameAr: "البنك السعودي للأستثمار",
    },
    {
      samaCode: "15",
      bankName: "Bank AlBilad ",
      nameEn: "BANK ALBELAD",
      nameAr: "بنك البلاد",
    },
    {
      samaCode: "30",
      bankName: "Arab National Bank",
      nameEn: "Arab National Bank",
      nameAr: "البنك العربي الوطني",
    },
    {
      samaCode: "90",
      bankName: "GULF Bank",
      sarieCode: "GULFSARI",
      nameEn: "Gulf International Bank",
      nameAr: "بنك الخليج",
    },
    {
      samaCode: "95",
      bankName: "Emirates Bank",
      nameEn: "EMARITE BANK",
      nameAr: "بنك الامارات",
    },
    {
      samaCode: "76",
      bankName: "Bank Muscat",
      nameEn: "Bank Muscat",
      nameAr: "بنك مسقط",
    },
    {
      samaCode: "71",
      bankName: "National Bank of Bahrain",
      nameEn: "National Bank Of Bahrain",
      nameAr: "بنك البحرين الوطني",
    },
    {
      samaCode: "75",
      bankName: "National Bank of Kuwait",
      nameEn: "National Bank of Kuwait",
      nameAr: "بنك الكويت الوطني",
    },
    {
      samaCode: "85",
      bankName: "BNP Paribas Bank",
      nameEn: "BNP PARIBAS SAUDI ARABIA",
      nameAr: "بي ان بي باريبوس",
    },
  ];

  function ValidateIBAN(iban) {
    if (!iban) {
      return false;
    }

    iban = iban.trim(); 

    if (iban.length !== 24) {
      return false;
    }

    if (!iban.startsWith("SA")) {
      return false;
    }

    return true;
  }
  function GetBankByIban() {
    const iban = document.getElementById("iban").value;
    if (!ValidateIBAN(iban)) alert("Your IBAN Not Correct");
    else {
      const BankCode = iban.substring(4, 6); //get sama code
      const bankName = banks.find((b) => b.samaCode === BankCode);
      alert("Your Iban Is Correct" + " " + bankName.nameAr);
    }
  }

  return (
    <>
      <div className="center">
        <div className="container  mt-5">
          <div className="row">
            <div className="col-md-6 offset-md-3">
              <div className="card shadow-lg p-3 mb-5 bg-body rounded ">
                <div className="card-header ">
                  <h1>IBAN Cheaker </h1>
                </div>
                <div className="card-body">
                  <form>
                    <div className="form-group">
                      <label htmlFor="iban">IBAN </label>
                      <input
                        type="text"
                        name="iban"
                        id="iban"
                        className="form-control border-4 border border-secondary"
                      />
                    </div>
                    <div className="form-group">
                      <button type="submit" className="btn btn-primary mt-2">
                        Submit
                      </button>
                    </div>
                  </form>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
